import styled from 'styled-components';


const ChatStyled = styled.div `
    .chat-all {
        flex: 0.9;
        flex-grow: 4;
        overflow-y: scroll;
        overflow:hidden;
 
    }

    .header{
        display:flex;
        
    }
`

export default ChatStyled;
